import React from 'react'

const Services = () => {
    // const age = 18;
    // let msg;
    // if(age>=18){
    //     msg = "You're an adult";
    // }
    // else{
    //     msg = "You're a minor";
    // }
    let day = 1
    let msg;
    switch(day){
        case 1:
            msg = "Monday"
            break;
        case 2:
            msg = "Tuesday"
            break;
        case 3:
            msg = "Wednesday"
            break
        case 4:
            msg = "Thursday"
            break;
        case 5:
            msg = "Friday"
            break
        case 6:
            msg = "Saturday"
            break;
        case 7:
            msg = "Sunday"
            break;
        default:
            msg = "Invalid"
    }
    return (
        <>
        <h1>{msg}</h1>
        <p></p>
        </>
    )
}

export default Services
